		<text transform="matrix(1 0 0 1 81.3613 263.8032)" class="st0 st1 st2">Conoce la gran variedad de</text>
		<text transform="matrix(1 0 0 1 81.3613 298.6032)" class="st0 st1 st2">tacos de Mxico</text>
		<path class="st3" d="M715.1,99.4h660.5c-74.8,136.1-45,258.9-29.5,317.5l-631-1.1V99.4z"/>
		<text transform="matrix(1 0 0 1 736.3489 121.5795)" class="st0 st1 st4">El taco es una preparacin culinaria muy popular </text>
		<text transform="matrix(1 0 0 1 862.0489 152.1795)" class="st0 st1 st4">en Mxico es el antojito mexicano ms </text>
		<text transform="matrix(1 0 0 1 716.0489 182.8795)" class="st0 st1 st4">representativo de la cocina mexicana</text>
		<text transform="matrix(1 0 0 1 1193.7489 182.8795)" class="st0 st1 st4 st5"></text>
		<text transform="matrix(1 0 0 1 1193.7489 182.8795)" class="st0 st1 st4"> y se puede </text>
		<text transform="matrix(1 0 0 1 723.7489 213.4795)" class="st0 st1 st4">encontrar en todos los lugares de la repblica y </text>
		<text transform="matrix(1 0 0 1 737.4489 244.1795)" class="st0 st1 st4">en restaurantes mexicanos por todo el mundo.</text>
		<text transform="matrix(1 0 0 1 782.5489 305.4795)" class="st0 st1 st4">En la actualidad los tacos estn extendidos </text>
		<text transform="matrix(1 0 0 1 732.2489 336.0795)" class="st0 st1 st4">mundialmente como un tipo de comida rpida. </text>
